fields.short_description:
Представляем эксклюзивный набор из серии Minecraft, который впечатляет своими размерами и продуманным функционалом.

Конструктор рассчитан на детей 6-12 лет, но, поверьте, взрослый фанат игры тоже будет рад заполучить его в свою коллекцию.

Собранная конструкция представляет собой типичную деревенскую местность из Майнкрафт и включает основные постройки и сооружения:

Кузница – место, где игрок может изготовить или отремонтировать оружие, инструменты и броню. Верхняя часть здания откидывается, что позволяет рассмотреть внутреннюю обстановку мастерской;

Смотровая башня – используется для защиты от набегов зомби (позволяет истреблять врагов с безопасного расстояния);

Библиотека – симпатичный домик с книжными полками и другими обязательными атрибутами (чтобы увидеть убранство, достаточно открыть конструкцию);

Дом местного жителя с огороженным крыльцом – также открывается, предоставляя доступ к внутреннему интерьеру;

Рынок – здесь можно купить у фермера полезные товары, которые выложены на прилавке;

Огород – предназначен для выращивания разнообразных агрокультур;

Загон с открывающейся калиткой – специальное место для содержания домашних животных;

Колодец – бесконечный источник воды, здесь игрок может пополнить запасы живительной влаги;

Отдельно стоит рассказать о мини-фигурках, которых в этом наборе 8:

Стив (с железным мечом) и Алекс (с алмазной киркой) – главные герои игры, путешествующие по виртуальному миру в поисках приключений.

2 деревенских жителя (библиотекарь и фермер) – дружелюбные мобы с характерной внешностью: большая голова, густые брови, крупный нос, руки скрещены на груди.

Железный голем – защищает обитателей деревни от враждебных мобов.

Зомби – опасное существо, нападающее на деревенских жителей.

Свинья – домашнее животное.

Крипер – зеленый моб-камикадзе (приблизившись к игроку, взрывается) без рук.

Приключения Стива и других персонажей из игры Майнкрафт в деревне.

