fields.short_description:
Вы вместе с Алекс построили замечательный домик на дереве, где можно пасти овец, выращивать какао и пшеницу, готовить печенье. Но враждебные мобы собираются в лесной чаще вокруг вашего нового домика. Прогоните нападающих совместными усилиями: ты, Алекс и ваш ручной оцелот! Активируй тайный люк, чтобы внезапно появиться перед ходячим скелетом. Замани взрывающегося Крипера (Creeper) в люк на полу и спрячься от него, быстро спустившись по прохладному водопаду. Погрузись в безудержные приключения Minecraft!

Пожалуй, самый яркий и функциональный набор в серии!

В собранном виде получается довольно большая и красочная конструкция – фрагмент богатого растительностью биома «джунгли», в котором можно выделить несколько блоков:

расположенный на дереве дом, взобраться на который можно по лестнице из блоков;
небольшой огород (тоже находится на дереве), где растет пшеница;
загон для овцы с открывающейся калиткой;
красивый водопад, по которому можно спускаться вниз (прямо как в игре!) – для этого нужно нажать на специальный рычажок, замаскированный лианами.
Сам дом заслуживает особого внимания. Здесь есть:

сундук для хранения вещей;
верстак – обязательный атрибут любого дома в Майнкрафт, ведь он необходим для создания инструментов и сложных предметов;
комната с кроватью;
смотровая площадка – удобное место для наблюдения за монстрами;
ловушка для незваных гостей – люк (открывается и закрывается с помощью рычага), под которым расположена лава (враждебным мобам там самое место).
В набор входит 6 мини-фигурок, в том числе:

Стив – одет в синие штаны и голубую футболку;
Алекс (персонаж для девушек, играющих в Майнкрафт) – рыжеволосая красотка в зеленом платье.
Крипер – моб-камикадзе, который незаметно приближается к игроку и взрывается рядом с ним;
Скелет – шустрый противник, того и гляди выпустит стрелу из своего лука.
Овца – незаменимый источник шерсти и мяса;
Оцелот – дикая кошка, которую можно приручить.

